import React from 'react'
import "./HeroStyles.css";
const Hero = () => {
  return (
    <div className="hero-text">
      <h1>Turning ideas into reality....</h1>
      <img style="width: 100%; object-fit: cover;"
         alt="HeroImg"
         src="https://images.unsplash.com/photo-1536148935331-408321065b18?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=387&q=80"/>
    </div>
  )
}

export default Hero;
